function renderPosts(n){n.length?n.forEach(n=>{jQuery(".agency-content-wrapper").append(preparePost(n))}):jQuery(".agency-content-wrapper").append("<p>Nothing to show</p>")}function preparePost(n){const{title:t,category_title:e,logo_img:a,rating:o,rating_name:s,text:r}=n;return`\n        <div class="agency-content">\n            <div class="agency-content-header d-flex">\n                <div class="agency-content-logo">\n                    <img src=${a} alt="logo">\n                </div>\n                <h3 class="agency-content-title">${t} <span>${e}</span> </h3>\n            </div>\n            <div class="agency-content-vote">\n                <span>${s}</span>${'<span><img src="./icon-star.svg" alt="icon"></span>'.repeat(Number(o))}\n            </div>\n            <div class="agency-content-text">\n                ${r}\n            </div>\n        </div>\n   `}function sortBy(n,t){if(n&&n.target.value){const{origin:e,pathname:a}=window.location;document.location.href=`${e}${a}?sort_by_${t}=${n.target.value}`}}function generatePagination(n){if(Number(n.total_pages))for(let t=1;t<=Number(n.total_pages);t++)jQuery(".pagination-lg").append(`<li class="page-item"><a class="page-link" href="./reviews.html?current_page=${t}">${t}</a></li>`)}jQuery(document).ready(()=>{let n=[];axios({method:"GET",url:"https://demo5926627.mockable.io/test.json"+(window.location.search?window.location.search:"?current_page=1"),responseType:"application/json"}).then(t=>{renderPosts(n=t.data.data&&t.data.data.posts?t.data.data.posts:[]),generatePagination(t.data.data)}).catch(t=>{console.log(t),renderPosts(n)})});